int longestSubarray(int* nums, int numsSize, int limit) {
    if(nums == NULL || numsSize == 0) {
        return 0;
    }

    int min_t,max_t;
    int res = 0;
    int res_t = 0;
    int i,j;

    for(i=0;i<numsSize;i++) {
        min_t = nums[i];
        max_t = nums[i];
        res_t = 1;
        if((numsSize - i) <= res) {
            break;
        }
        for(j=i+1;j<numsSize;j++) {
            if(nums[j] > max_t) {
                if( (nums[j] - min_t) <= limit ) {
                    max_t = nums[j];
                } else {
                    break;
                }
            } else if (nums[j] < min_t){
                if( (max_t - nums[j]) <= limit ) {
                    min_t = nums[j];
                } else {
                    break;
                }
            } else {

            }
            res_t++;
        }
        if(res_t > res) {
            res = res_t;
        }
        if(j == numsSize) {
            break;
        }
    }

    return res;
}


